def packing_combinations(total_books):
    combinations = []
    for books_a in range(1, total_books + 1, 5):
        for books_b in range(0, total_books - books_a + 1, 7):
            books_c = total_books - books_a - books_b
            if books_c % 4 == 0:
                combinations.append((books_a, books_b, books_c))
    return combinations

